import React from "react";

 const Ninjas= (props)=> {
  const { ninjas } = props;
  const ninjaList = ninjas.map((ninja,index) => {
    return (
      <div key={ninja.id}>
        <p>name: {ninja.name}</p>
        <p>age: {ninja.age}</p>
        <p>belt: {ninja.belt} ,</p>
      </div>
)
  })
  return (
    <div>
      { ninjaList }
    </div>
  )
}


export default Ninjas;
